	render(){
		const {
			props: {
				manifest,
				weapon
			}
		} = this;
		buildEnhancedStat(
			manifest,
			manifest.DestinyInventoryItemDefinition[3993415705],
			manifest.DestinyInventoryItemDefinition[981914802]
		)
		return (
			<div className="weapon__tab weapon__masterworks">
				<span className="uppercase tracked-wide underline">Masterworks</span>
				{ 
					// console.log(manifest.DestinyInventoryItemDefinition[weapon.hash]) 



				}


			</div>
		)
	}
}

const mapStateToProps = state => ({
	manifest: state.manifest,
	weapon: state.weapon,
});

export default connect(mapStateToProps, {

})(Masterworks);
